import React, { useEffect, useState } from "react";
import axios from "axios";
const tmdb = "https://api.themoviedb.org/3/movie/";
const key = "api_key=680e609baa2671cc67cf4d6797aaff0b";

const Browser = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    axios
      .get(`${tmdb}popular?${key}&language=en-US&page=1`)
      .then((res) => res.data)
      .then((data) => setItems(data.results));
  }, []);
  console.log(items);
  return (
    <div>
      <ul>
        {items.map((item) => (
          <li>
            <article key={item.id}>
              <h2>{item.title}</h2>
              <ol>
                <ol>
                  overview: <span>{item.overview}</span>
                </ol>
              </ol>
            </article>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Browser;
